) Instructs the Relay-chain to add the amount of DOT to the Instantaneous Coretime Market Credit account of who. It is expected that Instantaneous Coretime Market Credit on the Relay-chain is NOT transferrable and only redeemable when used to assign cores in the Instantaneous Coretime Pool. assign_core Prototype: type PartsOf57600 = u16;
